const projectTable = [
    {
        title: 'Job #',
        dataIndex: 'job_number',
        render: (text) => <a>{text}</a>,
    },
    {
        title: 'Project name',
        dataIndex: 'project_name',
    },
    {
        title: 'Created by',
        dataIndex: 'created_by',
    },
    {
        title: 'Created date',
        dataIndex: 'created_at_date',
    },
    {
        title: 'Created time',
        dataIndex: 'created_time',
    },
];

const wellInfoFormTable = [
    {
        title: 'Well name',
        dataIndex: 'well_name',
        align: 'center'
    },
    {
        title: 'Well API',
        dataIndex: 'well_api',
        align: 'center'
    },
    {
        title: 'Formation',
        dataIndex: 'formation',
        align: 'center'
    },
    {
        title: 'Lat',
        dataIndex: 'lat',
        align: 'center'
    },
    {
        title: 'Easting',
        dataIndex: 'easting',
        align: 'center'
    },
    {
        title: 'Northing',
        dataIndex: 'northing',
        align: 'center'
    },
];

const TableHeadersUtil = {
    projectTable,
    wellInfoFormTable
}

export default TableHeadersUtil;
